import style from "./Courses.module.css";

function coursesMenu(props) {
  return (
    <div className={style.container}>
      <div>
        {props.suserCourses.map((p) => (
          <div key={p.id}>
            <div>{p.courseName}</div>
            <div>
              {props.state.courses.courses.steps.map((j) => (
                <div key={j.id}>
                  <div>{j.stepTitle}</div>
                  <div>{j.stepType}</div>
                  <div>{j.stepContent}</div>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
export default coursesMenu;
